#include <bits/stdc++.h>
using namespace std;
int main() {
  string s;
  int k;
  cin >> s >> k;
  int cnt = 0;
  for (int i = 0; i < s.size(); i++) {
    if (s[i] == 'a' || s[i] == 'e' || s[i] == 'i' || s[i] == 'o' ||
        s[i] == 'u')
      cnt++;
  }
  if (cnt < k)
    cout << "impossible";
  else {
    int ans = 0;
    for (int i = 0; i < s.size(); i++) {
      if (s[i] == 'a' || s[i] == 'e' || s[i] == 'i' || s[i] == 'o' ||
          s[i] == 'u')
        continue;
      else
        ans++;
    }
    if (ans < k - cnt)
      cout << "impossible";
    else
      cout << ans;
  }
  return 0;
}

