  vector<vector<int> > b(n);
  for (int i = 0; i < m; i++) {
    int x, y;
    cin >> x >> y;
    x--;
    y--;
    b[x].push_back(y);
    b[y].push_back(x);
  }
  int ans = -1;
  for (int i = 0; i < n; i++) {
    for (int j = 0; j < n; j++) {
      if (i == j) continue;
      for (int k = 0; k < n; k++) {
        if (i == k || j == k) continue;
        if (binary_search(b[i].begin(), b[i].end(), k)) {
          ans = max(ans, a[i] + a[j] + a[k]);
        }
      }
    }
  }
  cout << ans << endl;
  return 0;
}

