#include <bits/stdc++.h>
using namespace std;
int main() {
  string s;
  cin >> s;
  int n = s.size();
  int dp[n + 1][n + 1];
  for (int i = 0; i <= n; i++) {
    for (int j = 0; j <= n; j++) {
      dp[i][j] = 0;
    }
  }
  for (int i = 0; i < n; i++) {
    if (s[i] == '4' || s[i] == '7') {
      dp[i][i] = 1;
    }
  }
  for (int i = 1; i < n; i++) {
    for (int j = 0; j < n - i; j++) {
      if (s[j] == '4' || s[j] == '7') {
        if (s[j + 1] == '4' || s[j + 1] == '7') {
          dp[j][j + i] = dp[j + 1][j + i] + 1;
        }
      }
    }
  }
  int max = 0;
  int maxi = 0;
  for (int i = 0; i < n; i++) {
    for (int j = i; j < n; j++) {
      if (dp[i][j] > max) {
        max = dp[i][j];
        maxi = j - i + 1;
      }
    }
  }
  if (max == 0) {
    cout << -1 << endl;
  } else {
    for (int i = 0; i < n - maxi + 1; i++) {
      if (s[i] == '4' || s[i] == '7') {
        cout << s[i];
        break;
      }
    }
  }
  return 0;
}

