int main() {
  int n, b;
  cin >> n >> b;
  int a[n];
  for (int i = 0; i < n; i++) cin >> a[i];
  int sum = 0;
  for (int i = 0; i < n; i++) sum += a[i];
  if (sum > b) {
    cout << -1;
    return 0;
  }
  int diff = b - sum;
  int avg = diff / n;
  int rem = diff % n;
  for (int i = 0; i < n; i++) {
    cout << fixed << setprecision(6) << (a[i] + avg + (rem > 0? 1 : 0))
         << endl;
    rem--;
  }
  return 0;
}

