  while (i < s.size() && j < a.size()) {
    if (s[i] == a[j]) {
      i++;
      j++;
    } else
      i++;
  }
  if (j == a.size()) {
    j = 0;
    while (i < s.size() && j < b.size()) {
      if (s[i] == b[j]) {
        i++;
        j++;
      } else
        i++;
    }
