int main() {
  int n, vb, vs, x[100], u, v, i, j, k, l, m, nn, mm, ans = 0, t, tt;
  double d, dd, ddd;
  scanf("%d%d%d", &n, &vb, &vs);
  for (i = 0; i < n; i++) scanf("%d", &x[i]);
  scanf("%d%d", &u, &v);
  d = sqrt((double)(u * u + v * v));
  dd = d / vb;
  ddd = d / vs;
  for (i = 1; i < n; i++) {
    t = x[i] - x[i - 1];
    tt = t / vb;
    if (ddd * tt > dd) {
      dd = ddd * tt;
      ans = i;
    }
  }
  printf("%d\n", ans + 1);
  return 0;
}

