		for (int i = 0; i < s2a.length; i++) {
			if (map.containsKey(s2a[i])) {
				map.put(s2a[i], map.get(s2a[i]) - 1);
				if (map.get(s2a[i]) == 0) {
					map.remove(s2a[i]);
				}
			} else {
				flag = false;
				break;
			}
		}
		if (flag && map.size() == 0) {
			System.out.println("YES");
		} else {
			System.out.println("NO");
		}
	}
}

