public class Main {

	public static void main(String[] args) throws IOException {
		BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
		int n = Integer.parseInt(br.readLine());
		int[] x = new int[n];
		int[] y = new int[n];
		for (int i = 0; i < n; i++) {
			String[] s = br.readLine().split(" ");
			x[i] = Integer.parseInt(s[0]);
			y[i] = Integer.parseInt(s[1]);
		}
		int ans = 0;
		for (int i = 0; i < n; i++) {
			for (int j = i + 1; j < n; j++) {
				if (x[i] == x[j] && y[i] == y[j]) {
					ans++;
				} else {
					int a = x[i] - x[j];
					int b = y[i] - y[j];
					int c = a * a + b * b;
					for (int k = 0; k < n; k++) {
						if (k == i || k == j) {
							continue;
						}
						int d = x[k] - x[j];
						int e = y[k] - y[j];
						int f = d * a + e * b;
						if (f % c == 0) {
							ans++;
						}
					}
				}
			}
		}
		System.out.println(ans);
	}
}

