public class Main {

	static class Point implements Comparable<Point> {
		int x, y;

		Point(int x, int y) {
			this.x = x;
			this.y = y;
		}

		@Override
		public int compareTo(Point o) {
			if (x!= o.x)
				return x - o.x;
			return y - o.y;
		}

		@Override
		public String toString() {
			return "(" + x + ", " + y + ")";
		}
	}

	static int ccw(Point p0, Point p1, Point p2) {
		int dx1 = p1.x - p0.x;
		int dy1 = p1.y - p0.y;
		int dx2 = p2.x - p0.x;
		int dy2 = p2.y - p0.y;
		if (dx1 * dy2 - dx2 * dy1 > 0)
			return 1;
		if (dx1 * dy2 - dx2 * dy1 < 0)
			return -1;
		if (dx1 * dx2 + dy1 * dy2 < 0)
			return 2;
		if (dx1 * dx + dy1 * dy == 0 || dx2 * dx + dy2 * dy == 0)
			return 0;
		return 3;
	}

	static boolean isInside(Point[] p, Point q) {
		int n = p.length;
		int cnt = 0;
		for (int i = 0; i < n; i++) {
			Point a = p[i];
			Point b = p[(i + 1) % n];
			if (ccw(a, b, q) == 1)
				cnt++;
		}
		return cnt % 2 == 1;
	}

	public static void main(String[] args) throws IOException {
		BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
		int n = Integer.parseInt(br.readLine());
		Point[] p = new Point[n];
		for (int i = 0; i < n; i++) {
			String[] s = br.readLine().split(" ");
			p[i] = new Point(Integer.parseInt(s[0]), Integer.parseInt(s[1]));
		}
		int m = Integer.parseInt(br.readLine());
		Point[] q = new Point[m];
		for (int i = 0; i < m; i++) {
			String[] s = br.readLine().split(" ");
			q[i] = new Point(Integer.parseInt(s[0]), Integer.parseInt(s[1]));
		}
		Arrays.sort(p);
		Arrays.sort(q);
		boolean ok = true;
		for (int i = 0; i < m; i++) {
			if (!isInside(p, q[i])) {
				ok = false;
				break;
			}
		}
		System.out.println(ok? "YES" : "NO");
	}
}

import java.io.BufferedReader;
import java.io.IOException;
import java.io.InputStreamReader;
import java.io.PrintWriter;
import java.util.StringTokenizer;

public class Main {
	public static void main(String[] args) throws IOException {
		new Main().run();
	}

	BufferedReader in;
	PrintWriter out;
	StringTokenizer st;

	public String nextToken() throws IOException {
		while (st == null ||!st.hasMoreTokens()) {
			st = new StringTokenizer(in.readLine());
		}
		return st.nextToken();
	}

	public int nextInt() throws IOException {
		return Integer.parseInt(nextToken());
	}

	public double nextDouble() throws IOException {
		return Double.parseDouble(nextToken());
	}

	public long nextLong() throws IOException {
		return Long.parseLong(nextToken());
	}

	public void solve() throws IOException {
		int s = nextInt();
		int a = nextInt();
		int b = nextInt();
		int c = nextInt();
		double x = 0, y = 0, z = 0;
		if (a == 0 && b == 0 && c == 0) {
			x = y = z = 0;
		} else if (a == 0 && b == 0) {
			x = s / c;
			y = z = 0;
		} else if (a == 0 && c == 0) {
			x = s / b;
			y = z = 0;
		} else if (b == 0 && c == 0) {
			x = y = z = 0;
		} else if (a == 0) {
			x = s / (b + c);
			y = z = 0;
		} else if (b == 0) {
			x = s / (a + c);
			y = z = 0;
		} else if (c == 0) {
			x = s / (a + b);
			y = z = 0;
		} else {
			x = s / (a + b + c);
			y = z = s / (a + b + c) - x;
		}
		out.printf("%.10f %.10f %.10f\n", x, y, z);
	}

	public void run() {
		try {
			in = new BufferedReader(new InputStreamReader(System.in));
			out = new PrintWriter(System.out);
			solve();
			out.close();
		} catch (IOException e) {
			e.printStackTrace();
			System.exit(1);
		}
	}
}

