			s[i] = st.nextToken();
		}
		int[][] d = new int[n][2];
		for(int i = 0; i < n; i++) {
			d[i][0] = s[i].charAt(0) - '0';
			d[i][1] = s[i].charAt(1) - 'A';
		}
