		for(int i = 0; i < n; i++) {
			for(int j = 0; j < n; j++) {
				if(i == 0) {
					dp[i][j] = 1;
				}
				else if(j == 0) {
					dp[i][j] = 0;
				}
				else if(i == j) {
					dp[i][j] = 1;
				}
				else if(i == j - 1) {
					if(d[i][0] == d[j][0] || d[i][1] == d[j][1]) {
						dp[i][j] = dp[i][j - 1] + 1;
					}
					else {
						dp[i][j] = dp[i][j - 1];
					}
				}
				else if(i == j - 2) {
					if(d[i][0] == d[j][0] || d[i][1] == d[j][1]) {
						dp[i][j] = dp[i][j - 2] + 1;
					}
					else {
						dp[i][j] = dp[i][j - 2];
					}
				}
				else {
					dp[i][j] = dp[i][j - 1];
				}
			}
		}
		if(dp[0][n - 1] == n) {
			System.out.println("YES");
		}
		else {
			System.out.println("NO");
		}
	}
}

