public class Main {

	public static void main(String[] args) throws IOException {
		BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
		int n = Integer.parseInt(br.readLine());
		int[] c = new int[n];
		StringTokenizer st = new StringTokenizer(br.readLine());
		for (int i = 0; i < n; i++) {
			c[i] = Integer.parseInt(st.nextToken());
		}
		int[][] g = new int[n][];
		for (int i = 0; i < n; i++) {
			st = new StringTokenizer(br.readLine());
			int k = Integer.parseInt(st.nextToken());
			g[i] = new int[k];
			for (int j = 0; j < k; j++) {
				g[i][j] = Integer.parseInt(st.nextToken()) - 1;
			}
		}
		int[][][] dp = new int[3][n][n];
		for (int i = 0; i < 3; i++) {
			for (int j = 0; j < n; j++) {
				Arrays.fill(dp[i][j], -1);
			}
		}
		for (int i = 0; i < n; i++) {
			for (int j = 0; j < n; j++) {
				if (i == j) {
					dp[c[i] - 1][i][j] = 0;
				} else {
					for (int k = 0; k < 3; k++) {
						if (dp[k][i][j]!= -1) {
							dp[k][i][j]++;
							for (int l = 0; l < g[j].length; l++) {
								int v = g[j][l];
								if (dp[k][i][v] == -1) {
									dp[k][i][v] = dp[k][i][j] + 1;
								}
							}
						}
					}
				}
			}
		}
		int ans = Integer.MAX_VALUE;
		for (int i = 0; i < 3; i++) {
			for (int j = 0; j < n; j++) {
				for (int k = 0; k < n; k++) {
					if (dp[i][j][k]!= -1) {
						ans = Math.min(ans, dp[i][j][k]);
					}
				}
			}
		}
		System.out.println(ans);
	}
}

