					for (int k = i + 1; k <= j; k++) {
						if (h[k - 1] + h[k] > h[i] && h[k - 1] + h[k] > h[j]) {
							dp[i][j] = Math.min(dp[i][j], dp[i + 1][k - 1] + dp[k][j - 1]);
						}
					}
				}
			}
		}
		System.out.println(dp[0][n - 1]);
	}
}

