					int count = 0;
					for (int j = start; j <= end; j++) {
						if (mem[j] == 0) {
							count++;
						}
					}
					if (count >= n) {
						for (int j = start; j <= end; j++) {
							if (mem[j] == 0) {
								mem[j] = 1;
								free[freeCount] = j;
								freeCount++;
								n--;
							}
						}
