				int end = -1;
				for (int j = 0; j < m; j++) {
					if (mem[j] == 1) {
						if (start == -1) {
							start = j;
						}
						end = j;
					}
				}
				if (start == -1) {
					System.out.println("ILLEGAL_ERASE_ARGUMENT");
				} else {
					int count = 0;
					for (int j = start; j <= end; j++) {
						if (mem[j] == 1) {
							count++;
						}
					}
					if (count == x) {
						for (int j = start; j <= end; j++) {
							if (mem[j] == 1) {
								mem[j] = 0;
								x--;
							}
						}
					} else {
						System.out.println("ILLEGAL_ERASE_ARGUMENT");
					}
				}
			} else {
				for (int j = 0; j < m; j++) {
					if (mem[j] == 0) {
						mem[j] = 1;
						free[freeCount] = j;
						freeCount++;
					}
				}
			}
		}
	}
}

