def dfs(v, color, used):
    used[v] = True
    for u in graph[v]:
        if not used[u]:
            color[u] = color[v]
            dfs(u, color, used)
        elif color[u] == color[v]:
            color[u] = (color[u] + 1) % K


def solve():
    N, M = map(int, input().split())
    graph = [[] for _ in range(N)]
    for _ in range(M):
        u, v = map(int, input().split())
        u -= 1
        v -= 1
        graph[u].append(v)

    K = 1
    color = [0] * N
    used = [False] * N
    for i in range(N):
        if not used[i]:
            dfs(i, color, used)
            K = max(K, max(color) + 1)

    print(K)
    for i in range(M):
        u, v = map(int, input().split())
        u -= 1
        v -= 1
        print(color[u] + 1, end=' ')


